import React from 'react';
import '../styles/menuitems.css';

function MenusItems() {
    return (  
        <div>
            <a>News</a>
            <a>Videos</a>
            <a>Reviews</a>
            <a>Shows</a>
            <a>Wikis</a>
        </div>
    );
}

export default MenusItems;
